const Home =() => {
	return ( 
		<>

		
		<div className="mx-5">
		     <div className="row justify-content-md-center  bg-dark">
		            <div className="col-md-auto"><h1 className="text-white">Welcome</h1></div>
		      </div>
		      <br />
		      <div className="row justify-content-center  bg-dark">
		            <div classNameName="col-md-auto"><p classNameName="text-white">Hey there am your smakel !</p></div>
		      </div>
		</div>
		
		
			
		</>
		);
};

export default Home;
